import React from 'react';

const Homeslider = () => {
    return(
        <>
        <section class="video-wrapper" id='video_wrapper'>
            <iframe src="https://www.youtube.com/embed/uqY6BQQ-u2o?autoplay=1&amp;mute=0&amp;loop=1&amp;controls =0&amp;rel=0&amp;showinfo=0&amp;modestbranding=1&amp;fs=0" frameborder="0" allow="accelerometer; autoplay=1; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen=""></iframe>
        </section>
        </>
    );
}

export default Homeslider
